import React, { Component } from "react";

export default class Credit extends Component {
  render() {
    return (
      <React.Fragment>
        <p className="credit">
          Create with <strong>&hearts;</strong> in <strong>Berlin</strong>&nbsp;
          using <strong>React</strong> & <strong>BigChainDB</strong>
        </p>
      </React.Fragment>
    );
  }
}
